import React, { ComponentPropsWithoutRef } from 'react'
imo

type HoverProps = ComponentPropsWithoutRef<"div">

type Props = {
  className?: string
  parent?: any
  children?: any
} & HoverProps

const HoverEffect: React.FC<Props> = ({className, parent, children, ...props}) => {
  return (
    <>
      <div className={["Maker", className].join(" ")} {...props}>
        { parent }
        <div className='tip'>{ children }</div>
      </div>
    </>
  )
}

export default HoverEffect
